import React from "react";

const Table = (props) => {
    if (props.data.length > 0)
       { return <>
            <table>
                <thead>
                    <tr>
                        {console.log(props)}
                        {
                            Object.keys(props.data[0]).map(title => {
                                <th key={title}>
                                    {title}
                                </th>
                            })
                        }
                    </tr>
                </thead>
            </table>
        </>}
}

export default Table
